import React from 'react'
import Navbar from '../../HomePage/Navbar/Navbar'
import NextjsCourseData from './NextJsCourseData'

const NextJsCourse = () => {
    return (
        <div>
            <Navbar />
            <template props={nextjsCourseData} />
        </div>
    )
}

export default NextJsCourse
